import React, {useState, useEffect} from "react";
import '../Component/Category.css';
import axios from "axios";
import { Link } from "react-router-dom";

export default function Category(){

    return(
    <>
      <div className="container">
        <br />
        <h3>Pilih Kategori</h3>
        <br />
        <button onClick={'/photos/animals'}>
        <div className="button-Go">Animals</div>
        </button>
        <button onClick={'/photos/plants'}>
        <div className="button-Go">Plants</div>
        </button>
        <button onClick={'/photos/natures'}>
        <div className="button-Go">Nature</div>
        </button>
      </div>
      </>
 )
}
